            + "\15\0\1\20\13\0\1\20\6\0\31\20\4\0\4\20"
            + "\1\u01e1\23\20\5\0";

    private static int[] zzUnpackTrans() {
        int[] result = new int[32300];
        int offset = 0;
        offset = zzUnpackTrans(ZZ_TRANS_PACKED_0, offset, result);
        return result;
    }

    private static int zzUnpackTrans(String packed, int offset, int[] result) {
        int i = 0;
        /* index in packed string  */
        int j = offset;
        /* index in unpacked array */
        int l = packed.length();
        while (i < l) {
            int count = packed.charAt(i++);
            int value = packed.charAt(i++);
            value--;
            do {
                result[j++] = value;
            } while (--count > 0);
        }
        return j;
    }

    /**
     * Error code for "Unknown internal scanner error".
     */
    private static final int ZZ_UNKNOWN_ERROR = 0;
    /**
     * Error code for "could not match input".
     */
    private static final int ZZ_NO_MATCH = 1;
    /**
     * Error code for "pushback value was too large".
     */
    private static final int ZZ_PUSHBACK_2BIG = 2;

    /**
     * Error messages for {@link #ZZ_UNKNOWN_ERROR}, {@link #ZZ_NO_MATCH}, and
     * {@link #ZZ_PUSHBACK_2BIG} respectively.
     */
    private static final String ZZ_ERROR_MSG[] = {
        "Unknown internal scanner error",
        "Error: could not match input",
        "Error: pushback value was too large"
    };

    /**
     * ZZ_ATTRIBUTE[aState] contains the attributes of state {@code aState}
     */
    private static final int[] ZZ_ATTRIBUTE = zzUnpackAttribute();

    private static final String ZZ_ATTRIBUTE_PACKED_0
            = "\6\0\1\1\2\0\1\11\4\1\1\11\1\1\1\11"
            + "\1\1\4\11\1\1\1\11\1\1\1\11\1\1\2\11"
            + "\24\1\3\11\21\1\1\11\1\1\1\11\1\1\2\11"
            + "\3\1\1\11\1\1\1\11\4\1\2\11\5\1\1\11"
            + "\3\1\7\11\2\1\1\11\1\0\1\11\1\0\5\11"
            + "\1\0\5\11\75\1\1\11\2\1\1\11\4\1\2\0"
            + "\4\11\21\1\1\11\u010c\1";

    private static int[] zzUnpackAttribute() {
        int[] result = new int[481];
        int offset = 0;
        offset = zzUnpackAttribute(ZZ_ATTRIBUTE_PACKED_0, offset, result);
        return result;
    }

    private static int zzUnpackAttribute(String packed, int offset, int[] result) {
        int i = 0;
        /* index in packed string  */
        int j = offset;
        /* index in unpacked array */
        int l = packed.length();
        while (i < l) {
            int count = packed.charAt(i++);
            int value = packed.charAt(i++);
            do {
                result[j++] = value;
            } while (--count > 0);
        }
        return j;
    }

